using System;
using System.Collections.Generic;
using System.Data;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using AuctionHouse.ClassLibrary.Model;
using AuctionHouse.DataAccessLayer.DAO;
using AuctionHouse.DataAccessLayer.Interfaces;
using System.Data.SqlClient;
using Xunit.Abstractions;
using AuctionHouse.DataAccessLayer.DAO;
using System.Data.SqlClient;

namespace AuctionHouse.Test.DaoTests
{
    public class ItemDaoTest
    {
        #region Fields
        private readonly IDbConnection _connection;
        private readonly IItemDao _itemDao;
        private readonly ITestOutputHelper _output;

        //Teardown path
        //@ means where we are. From there ".." means out of the folder, we do that
        //twice and then go into the SQL-Script folder
        private readonly string _truncateScriptPath = "TruncateTables.sql";
        //Generate testdata path
        private readonly string _generateTestDataScriptPath = "GenerateTestData.sql";
        //Both are added as links by rightclicking the AuctionHouse.Test Project
        //adding them as links, then chaning their properties to Build "Content" and Copy to
        //output directory to "Copy if newer"
        #endregion

        #region Constructor
        public ItemDaoTest(ITestOutputHelper output)
        {
            _output = output;

            _output.WriteLine("Test Constructor: Attempting to read environment variable...");
            string connectionString = Environment.GetEnvironmentVariable("DatabaseConnectionString");

            
            _output.WriteLine($"Test Constructor: Retrieved Connection String: '{connectionString ?? "NULL"}'");
                
            if (string.IsNullOrEmpty(connectionString))
            {
                _output.WriteLine("Test Constructor: FATAL - Connection string is null or empty."); // Log before throwing
                // Consider throwing a more specific exception or using Assert.True within a test setup method if applicable
                throw new InvalidOperationException("FATAL: DatabaseConnectionString environment variable is not set or is empty. Check test configuration.");
            }

            _output.WriteLine("Test Constructor: Creating SqlConnection...");
            _connection = new SqlConnection(connectionString);
            _output.WriteLine("Test Constructor: Creating ItemDAO...");
            _itemDao = new ItemDAO(_connection);
            _output.WriteLine("Test Constructor: Setup complete.");

            //For debugging filepath. first where are we. Second write out path for Truncate. Third wirte out path for Generate test data
            _output.WriteLine("Working Directory: " + Environment.CurrentDirectory);
            _output.WriteLine("Expected Truncate Script Path: " + Path.GetFullPath(_truncateScriptPath));
            _output.WriteLine("Expected Generate Script Path: " + Path.GetFullPath(_generateTestDataScriptPath));

            //Clean Tables (Ekstra to ensure that theres no leftovers or random entries)
            ExecuteSqlScript(_truncateScriptPath);
            //Generate testdata
            ExecuteSqlScript(_generateTestDataScriptPath);
        }
        #endregion

        #region Build up and tear down methods
        //Execute SQL Script method from filepath
        private void ExecuteSqlScript(string filePath)
        {
            //reads all text from the passed file path
            string sql = File.ReadAllText(filePath);

            //creates command with connection, and runs
            //command with the SQL copied from the passed filepath
            using var command = _connection.CreateCommand();
            command.CommandText = sql;

            //Open connection if it isnt open
            if (_connection.State != ConnectionState.Open)
            {
                _connection.Open();
            }
            //Execute command
            command.ExecuteNonQuery();
        }

        // Clean up after each test
        public void Dispose()
        {
            ExecuteSqlScript(_truncateScriptPath); 
        }
        #endregion

        #region Test
        [Fact]
        public async Task GetAllAsync_ShouldReturnListOfItems()
        {
            // Act
            Console.WriteLine($"env var: {Environment.GetEnvironmentVariable("DatabaseConnectionString")}");
            List<Item> items = await _itemDao.GetAllAsync<Item>();

            // Assert   
            Assert.NotEmpty(items);
        }

        [Fact]
        public async Task GetByIdAsync_ShouldReturnItem_WhenItemExists()
        {
            // Arrange  
            int itemId = 1;
            // Act  
            Item? item = await _itemDao.GetByIdAsync<Item>(itemId);
            // Assert   
            Assert.NotNull(item);
            Assert.Equal(itemId, item?.ItemId);
        }

        [Fact]
        public async Task GetAllByUserId_ShouldReturnItems_WhenUserHasItems()
        {
            // Arrange  
            int userId = 1;
            // Act  
            IEnumerable<Item> items = await _itemDao.GetAllByUserId(userId);
            // Assert   
            Assert.NotNull(items);
            Assert.NotEmpty(items);
        }

        [Fact]
        public async Task InsertAsync_ShouldReturnId_WhenItemIsInserted()
        {
            // Arrange  
            UserDAO udao = new UserDAO(_connection);
            User user =  await udao.GetByIdAsync<User>(1);
            string bytestring2 = @"";

            Item item = new Item(user,"TestItem", "TestDescription", ClassLibrary.Enum.Category.COLLECTIBLES, Convert.FromBase64String(bytestring2), ClassLibrary.Enum.ItemStatus.AVAILABLE);
            // Act  
            int id = await _itemDao.InsertAsync(item);
            // Assert  
            Assert.True(id > 0);
        }
        #endregion

    }
}
